CREATE SCHEMA rybakova;
USE rybakova;

SET AUTOCOMMIT = 0;

CREATE TABLE Citizen_categories (
    citizen_category_id INT NOT NULL AUTO_INCREMENT,
    category_name VARCHAR(45),
    category_discount DOUBLE,
    PRIMARY KEY (citizen_category_id)
);

CREATE TABLE Patients (
    patient_id INT NOT NULL AUTO_INCREMENT,
    patient_surname VARCHAR(45),
    patient_name VARCHAR(45),
    patient_patronymic VARCHAR(45),
    patient_year_of_birth YEAR,
    citizen_category_id INT NOT NULL,
    PRIMARY KEY (patient_id),
    FOREIGN KEY (citizen_category_id)
        REFERENCES Citizen_categories (citizen_category_id)
        ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE Admissions (
    admission_id INT NOT NULL AUTO_INCREMENT,
    patient_id INT NOT NULL,
    treatment_cost DOUBLE,
    admission_date DATE,
    PRIMARY KEY (admission_id),
    FOREIGN KEY (patient_id)
        REFERENCES Patients (patient_id)
        ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE Doctors (
    doctor_id INT NOT NULL AUTO_INCREMENT,
    doctor_surname VARCHAR(45),
    doctor_name VARCHAR(45),
    doctor_speciality VARCHAR(45),
    doctor_qualification VARCHAR(45),
    service_cost DOUBLE,
    PRIMARY KEY (doctor_id)
);

CREATE TABLE Treatment_sheets (
    doctor_id INT NOT NULL,
    admission_id INT NOT NULL,
    diagnosis VARCHAR(45),
    diagnosis_time TIME,
    UNIQUE (doctor_id , admission_id , diagnosis , diagnosis_time),
    FOREIGN KEY (doctor_id)
        REFERENCES Doctors (doctor_id),
    FOREIGN KEY (admission_id)
        REFERENCES Admissions (admission_id)
        ON UPDATE CASCADE ON DELETE CASCADE
);






commit;